  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:41.579968\",\n\t\"name\": \"trempealeau-national-wildlife-refuge-annual-narrative-report-calendar-year-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Trempealeau
  NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the management
  plan, public participation, and research and investigations. Refuge administration
  is outlined; information about personnel, other manpower programs, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, grasslands, haying, fire management, and pest control.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  other migratory birds, game mammals, fisheries resources, wildlife propagation,
  and marking and banding. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
  observation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, major maintenance, equipment utilization
  and replacement, communication systems, and computer sytems. Cooperative programs
  and items of interest are provided at the end. Photographs and Refuge brochures
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
